import React from "react";
import "./App.css";
import "bootswatch/dist/flatly/bootstrap.css";

class App extends React.Component {
  render() {
    return (
      <div>
        <button type="button" class="btn btn-success">
          Success
        </button>
      </div>
    );
  }
}

export default App;
